import styled from "styled-components";

const Section = styled.section`
    display: flex;
    align-items: center;
    justify-content: center;
    background: linear-gradient(to right, #5f97fecc 0%, #8c53fecc 100%);
    padding: 2rem;
    `
const Div = styled.div`
    max-width: 1080px;
    background-color: #fff;
    border-radius: 20px;
    padding: 2rem;
`




function FaqText() {
    return (
        <>
            <Section>
                <Div>
                    <h1>FAQ - Preguntas frecuentes</h1>
                    <h1>
                        Como funciona a internet Fibra Ótica?
                    </h1>
                    <p>A Fibra Ótica é um meio de transmissão que permite o tráfego de dados com a velocidade da luz. O sinal na Fibra é transmitido através de reflexões de raios laser ao longo de todo o cabo, atingindo uma capacidade de transmissão única, que pode ser até um milhão de vezes maior que o cabo metálico ou coaxial, o que torna a Fibra uma das tecnologias de transmissão mais modernas do mundo.</p>
                </Div>
            </Section>
        
        </>


    )

}


export default FaqText
